import pytest

import vyper


def test_contract_size_exceeded():
    code = """
@external
def a() -> bool:
    q: Bytes[24577] = b""  # noqa: E501
    return True
"""
    with pytest.warns(vyper.warnings.ContractSizeLimitWarning):
        vyper.compile_code(code, output_formats=["bytecode_runtime"])
